import React from "react";
import logo from "../img/Pentagram.png"

const barStyles = {
    margin: "auto",
    display: "inline",
    height: "7%", /* 100% Full-height */
    width: "100%", /* 0 width - change this with JavaScript */
    position: "fixed", /* Stay in place */
    zIndex: "1", /* Stay on top */
    top: "0", /* Stay at the top */
    backgroundColor: "hsl(169, 60%, 60%)", /* purple*/
}

const barItem = {

    marginTop: "20%",
    paddingTop:"50%",
    display:"inline",
    paddingLeft:"12.5%",
    paddingRight:"12.5%",
    textDecoration:"none",
}

function center (){
    barItem.paddingLeft = (barStyles.width / 8)
    barItem.paddingRight = (barStyles.width / 8)
}



function Navbar(){

    center()

    return(
        <div>
            <ul style = {barStyles}>
                <li style = {barItem}><a href="home.html">home</a></li>
                <li style = {barItem}><a href="shop.html">Shop</a></li>
                <li style = {barItem}><a href="contact.html">Contact</a></li>
                <li style = {barItem}><a href="customize.html">Customize</a></li>
            </ul>
        </div>
    );
}

export default Navbar;
